import React from "react";
import NewNavbar from "./Navbar";
import Heading from "./Heading";
// import Skills from "./Skills";
import Projects from "./Projects";
import Footer from "./Footer";
import Main from "./Main";


function App() {
  return (
    <div className="body">
        <NewNavbar/>
        <Heading/>
        <Main/>
        <Projects/>
        <Footer/>
    </div>
  );
}

export default App;
